// src/components/UserProfileCard.js
import React from 'react';
import { Card, CardHeader, CardContent, Typography, Grid } from '@mui/material';

const UserProfileCard = () => {
  return (
    <Card>
      <CardHeader
        title="User Profile"
        
        sx={{ textAlign: 'center' }}
      />
      <CardContent>
        <Grid container spacing={2} justifyContent="center">
          <Grid item xs={12} md={6}>
            <Typography variant="body1">Name: John Doe</Typography>
            <Typography variant="body1">Email: john.doe@example.com</Typography>
            <Typography variant="body1">Business Type: Retail</Typography>
            <Typography variant="body1">Business Branches: 3</Typography>
            <Typography variant="body1">Phone Number: +1234567890</Typography>
            <Typography variant="body1">Company: XYZ Corporation</Typography>
            <Typography variant="body1">Expected Credit: $10,000</Typography>
            <Typography variant="body1">Number of Employees: 50</Typography>
          </Grid>
    
        </Grid>
      </CardContent>
    </Card>
  );
};

export default UserProfileCard;
